"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[5716],{5716:o=>{o.exports=JSON.parse('{"lessonId":"B1_U113","title":"\u0423\u0440\u043e\u043a 113: \u041f\u0440\u0435\u0434\u043b\u043e\u0433\u0438 (4)","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041f\u0440\u0435\u0434\u043b\u043e\u0433 `a`","content":[{"text":"<strong>\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `a`:</strong><br>- \u043f\u0435\u0440\u0435\u0434 \u043a\u043e\u0441\u0432\u0435\u043d\u043d\u044b\u043c \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435\u043c. <i>Le he regalado mi port\xe1til <strong>a</strong> Pedro.</i><br>- \u043f\u0435\u0440\u0435\u0434 \u043f\u0440\u044f\u043c\u044b\u043c \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435\u043c, \u0435\u0441\u043b\u0438 \u044d\u0442\u043e \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u044b\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u0436\u0438\u0432\u043e\u0442\u043d\u043e\u0435 \u0438\u043b\u0438 \u043f\u0435\u0440\u0441\u043e\u043d\u0438\u0444\u0438\u0446\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u043f\u0440\u0435\u0434\u043c\u0435\u0442. <i>Anoche vimos <strong>a</strong> Elena en el concierto.</i><br><strong>\u041d\u041e:</strong> \u043d\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f, \u0435\u0441\u043b\u0438 \u043f\u0440\u044f\u043c\u043e\u0435 \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u2014 \u043d\u0435\u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043d\u044b\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u043a. <i>Necesito <strong>un</strong> m\xe9dico.</i><br>- \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0446\u0435\u043b\u0438 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f. <i>El fontanero ha venido <strong>a</strong> arreglar el ba\xf1o.</i><br>- \u0434\u043b\u044f \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u0441\u043f\u043e\u0441\u043e\u0431\u0430 \u0438\u043b\u0438 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u0430. <i>Hoy hemos comido calamares <strong>a</strong> la romana.</i>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041f\u0440\u0435\u0434\u043b\u043e\u0433 `de`","content":[{"text":"<strong>\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `de`:</strong><br>- \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u044f. <i>Este es el despacho <strong>de</strong> Elvira.</i><br>- \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u044f. <i>Esos se\xf1ores son <strong>de</strong> Costa Rica.</i><br>- \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u0430, \u0442\u0435\u043c\u044b \u0438\u043b\u0438 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044f. <i>Me encantan las tartas <strong>de</strong> chocolate.</i>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041f\u0440\u0435\u0434\u043b\u043e\u0433\u0438 `para`, `en`, `sobre`","content":[{"text":"<strong>`para`:</strong> \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0446\u0435\u043b\u0438. <i>Necesito gafas de sol (gafas <strong>para</strong> protegerme del sol)</i>"},{"text":"<strong>`en`:</strong> \u0441 \u0432\u0438\u0434\u0430\u043c\u0438 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0430. <i>El viaje al Machu Picchu se hace <strong>en</strong> tren y <strong>en</strong> autob\xfas.</i><br><strong>\u041d\u041e:</strong> a pie, a caballo"},{"text":"<strong>`sobre`:</strong> \u0434\u043b\u044f \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0438\u043b\u0438 \u0442\u0435\u043c\u044b. <i>El cartero suele llegar <strong>sobre</strong> las diez. / Ma\xf1ana hay una conferencia <strong>sobre</strong> la globalizaci\xf3n.</i>"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u044f 113.1, 113.2, 113.3, 113.4","content":[{"text":"<strong>\u0412\u0441\u0435 \u0443\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u044f \u044d\u0442\u043e\u0433\u043e \u0443\u0440\u043e\u043a\u0430 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u044b.</strong>"}]}]}')}}]);